def solution(book_time):

    time_arr = []

    for time in book_time :
        start_time = time_to_second(time[0])
        end_time = time_to_second(time[1]) + 10
        time_arr.append([start_time, end_time])
    print(time_arr)
    time_arr.sort(key= lambda x : (x[0], x[1]))
    room_arr = [[] for _ in range(1010)]

    for t in time_arr :
        for rooms in room_arr :
            flag = False
            for room in rooms :
                if room[0] < t[1] <= room[1]:
                    flag = True
                    break
                if room[0] <= t[0] < room[1] :
                    flag = True
                    break
                if room[0] >= t[0] and room[1] <= t[1] :
                    flag = True
                    break
            if flag is False :
                rooms.append(t)
                break
            if len(rooms)==0 :
                rooms.append(t)
                break
            if flag is False:
                break
    answer = 0
    print(room_arr)
    for i in room_arr :
        if len(i) != 0 :
           answer += 1

    return answer


def time_to_second(time):
    time_split = time.split(':')
    time_temp = int(time_split[0]) * 60 + int(time_split[1])
    return time_temp

